import './phoneRight.scss';
import { useState } from 'react';

interface PhoneRightProps {
    classNameAdded: string;
    message: JSX.Element;
    messageScreen: JSX.Element;
}

const PhoneRight = ({ classNameAdded = '', messageScreen = <></> }: PhoneRightProps): JSX.Element => {

    const [active, setActive] = useState<boolean>(false);

    return (
            <div className={`phoneRight ${classNameAdded} ${active ? "phoneRight--active" : ""}`} onMouseEnter={() => setActive(true)}>
                <div className="phoneRight__base">
                    <div className="phoneRight__base__message-1">
                        {message}
                    </div>
                    <div className="phoneRight__base__screen">
                    </div>
                    <div className="phoneRight__base__camera-top">
                    </div>
                    <div className="phoneRight__base__microphone">
                    </div>
                    <div className="phoneRight__base__charger">
                    </div>
                    <div className="phoneRight__base__volume-1">
                    </div>
                    <div className="phoneRight__base__volume-2">
                    </div>
                    <div className="phoneRight__base__messageScreen">
                        {messageScreen}
                    </div>
                </div>
            </div>
    );
}

export default PhoneRight;
